a.27\"","            return 0","            ;;","        \"fedora.28\")","            echo \"fedora.28\"","            return 0","            ;;","        \"opensuse.13.2\")","            echo \"opensuse.13.2\"","            return 0","            ;;","        \"opensuse.42.1\")","            echo \"opensuse.42.1\"","            return 0","            ;;","        \"opensuse.42.3\")","            echo \"opensuse.42.3\"","            return 0","            ;;","        \"rhel.7\"*)","            echo \"rhel\"","            return 0","            ;;","        \"ubuntu.14.04\")","            echo \"ubuntu\"","            return 0","            ;;","        \"ubuntu.16.04\")","            echo \"ubuntu.16.04\"","            return 0","            ;;","        \"ubuntu.16.10\")","            echo \"ubuntu.16.10\"","            return 0","            ;;","        \"ubuntu.18.04\")","            echo \"ubuntu.18.04\"","            return 0","            ;;","        \"alpine.3.4.3\")","            echo \"alpine\"","            return 0","            ;;","    esac","    return 1","}","","get_legacy_os_name() {","    eval $invocation","","    local uname=$(uname)","    if [ \"$uname\" = \"Darwin\" ]; then","        echo \"osx\"","        return 0","    elif [ -n \"$runtime_id\" ]; then","        echo $(get_legacy_os_name_from_platform \"${runtime_id%-*}\" || echo \"${runtime_id%-*}\")","        return 0","    else","        if [ -e /etc/os-release ]; then","            . /etc/os-release","            os=$(get_legacy_os_name_from_platform \"$ID${VERSION_ID:+.${VERSION_ID}}\" || echo \"\")","            if [ -n \"$os\" ]; then","                echo \"$os\"","                return 0","            fi","        fi","    fi","","    say_verbose \"Distribution specific OS name and version could not be detected: UName = $uname\"","    return 1","}","","get_linux_platform_name() {","    eval $invocation","","    if [ -n \"$runtime_id\" ]; then","        echo \"${runtime_id%-*}\"","